import React, { Component } from "react";

import Navigation from "./Navigation";

const LINKS = [
  { label: "About", to: "#" },
  { label: "How it works", to: "#" },
  { label: "Contact", to: "#" },
];

class App extends Component {
  render() {
    return (
      <div>
        <Navigation links={LINKS} />
      </div>
    );
  }
}

export default App;
